import React from 'react'
import '../App.css';
import CARD from './CARD';


function GETCARDS({ state }) {

    const filterItem = id => {
        setState(prevState => prevState.filter(el => el.id !== id))
     } 

    return (
        <div className="cards">
            <CARD  state= {state} filterItem = {filterItem}/>
        </div>
    )


    
}
export default GETCARDS;
